import { GenericResult } from "@jacada-jbot/base/include/Model/GenericResult";
import { WebCustomControlCoverageHandler } from "./WebCustomControlCoverageHandler";
/**
 * Coverage handler for a checkbox
 */
export default class CheckBoxWebControlCoverageHandler extends WebCustomControlCoverageHandler {
    type: string;
    startRecording(): boolean;
    subscribeToCheckedChanged(): void;
    /**
     * This method sets the checkbox with the given value by dispatching change event on the node
     * @param isChecked - if true the check-box will be checked otherwise unchecked
     * @returns a GenericResult struct
     */
    setChecked(isChecked: boolean): GenericResult;
    /**
     * This method gets the property checked of the node.
     * @returns a GenericResult struct
     */
    getChecked(): GenericResult;
}
